'''王老吉娘'''是饮料品牌'''王老吉'''的[[拟人化]]萌娘。

== 简介 ==

出生于中国，一开始是卖凉茶的，{{黑幕|被称为凉茶西施}}。双胞胎姐妹红娘绿娘。

红娘后来因为生意做大了就有某国企想收回招牌，于是自我分裂出了红色外观的另一个王老吉娘，而原来的红色王老吉娘则改名为加多宝娘。
加多宝娘如今已经是金色包装了{{黑幕|长得和[[红牛饮料娘]]好像}}

